import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <>
            <h2>Home</h2>
            <button data-testid="student-btn">
                <Link to="/student">All Student</Link>
            </button>
        </>
    );
};

export default Home;
